import React from "react";
import {
  Box,
  Grid,
  Text,
  Accordion,
  Center,
} from "@mantine/core";
import {
  IconPlus,
  IconX,
  IconColumns1,
  IconBold,
  IconUnderline,
  IconItalic,
  IconLetterN,
} from "@tabler/icons-react";

const LatestProduct = () => {
  return (
    <Accordion.Item value="latest -product">
      <Accordion.Control bg="indigo.2">
        <Center>
          <Text fw={700}>Latest Product/ Recently Added</Text>
        </Center>
      </Accordion.Control>
      <Accordion.Panel>Content</Accordion.Panel>
    </Accordion.Item>
  );
};

export default LatestProduct;
